First, we compute the results inside the most inner brackets. 
SM 6 1 = (6+1)%10 = 7;
MAX 2 9 = 9;
SM 6 4 = (6+4)%10 = 0 (because sum modulo 10 of 6 and 4 is their sum modulo 10);
MAX 3 6 = 6.

So the expression simplifies to [MAX [MIN 7 9] [MIN 0 6]]

Next, we compute the results inside the new set of inner brackets.
MIN 7 9 = 7;
MIN 0 6 = 0.

So the expression simplifies further to [MAX 7 0]

Finally, we compute the result in the outer brackets.
MAX 7 0 = 7.

So the result of the expression is 7.
